#include <stdio.h>
#include <stdlib.h>
#include <string.h>
 
#include <algorithm>
#include <iostream>
 
#include <vector>
#include <string>
 
using namespace std;
 
#define all(c) (c).begin(),(c).end()
 
class SerialNumbers {
public:
  vector <string> sortSerials(vector <string>);
};
 
bool my_lt(string s1, string s2) {
  if (s1.size() != s2.size()) return s1.size() < s2.size();
  int cnt1=0, cnt2=0;
  for (int i=0; s1[i]; i++) if ('0' <= s1[i] && s1[i] <= '9') cnt1 += s1[i]-'0';
  for (int i=0; s2[i]; i++) if ('0' <= s2[i] && s2[i] <= '9') cnt2 += s2[i]-'0';
  if (cnt1 != cnt2) return cnt1 < cnt2;
  else return s1 < s2;
}
 
vector <string> SerialNumbers::sortSerials(vector <string> serialNumbers) {
  sort(all(serialNumbers), my_lt);
  return serialNumbers;
}

